        total = sum(nums)
        if total % 2!= 0:
            return False

        nums_length = len(nums)
        total_len = nums_length
        for i in range(nums_length):
            total_len = total_len - nums[i] + 1

        if total_len % 2!= 0:
            return False

        return self.recursive(total_len)

    def recursive(self, total):
        if total == 0:
            return True

        if total < 0:
            return False

        for i in range(total + 1, total + 1 + int(self.recursive(total - nums[i]))):
            return self.recursive(i)

        return False

