def solution(stdin: str) -> str:
    A, N = map(int, stdin.split())
    numbers = list(map(int, stdin.split()))
    result = [0] * N

    def recurse(i, j, k):
        if i >= N or j >= N or k >= A or k >= numbers[i]:
            return 0
        if i == j == k == 0:
            return 1
        if i == j == 0 or j == k == 0:
            return 0

        result[i] += recurse(i + 1, j, k)
        result[i] += recurse(i + 1, k + 1, j)
        result[i] += recurse(i, k + 1, j + 1)

        return result[i]

    return str(recurse(0, 0, 0) + recurse(0, 0, N - 1))

