def solution(stdin: str) -> str:
    import itertools
    from collections import Counter

    def plow(a, b):
        if a == b:
            return [a]

        res = []
        for c in plow(a + 1, b):
            if c not in res:
                res.append(c)
        for c in plow(a, b + 1):
            if c not in res:
                res.append(c)
        return res

    N, M = map(int, stdin.split())
    plow_set = plow(N, M)
    plow_set.sort(key=lambda x: abs(x[0] - M))
    for c in Counter(plow_set).keys():
        M -= c
    if M == 0:
        return "-"
    else:
        return str(M)


