def solution(stdin: str) -> str:
    C, P = map(int, stdin.split())
    num_of_square = (C * P) // (P + 1)
    queries = []
    for i in range(num_of_square):
        queries.append(i + 1)
    queries = set(queries)
    queries = list(queries)
    queries.sort()
    answer = 0
    for num in queries:
        if num == 2:
            break
        for i in range(num, num + P):
            answer += 1
    return answer

